import React, { Component } from "react";
import {
    NavLink,
} from "react-router-dom";
import './works.scss';
import ReactFullpage from '@fullpage/react-fullpage';
import delighters from "../common/delighters";

class Works extends Component {
    componentDidMount() {
        delighters.init();
    }
    render() {
        return (
            Fullpage()
        );
    }
}

export default Works;
